import joi from "joi";
import { badRequest, internalServerError } from "../middleware/heandle_error";
import *as services from "../seeders";
import { email,password,role_code } from "../validate/joi";
// import createHttpError from "http-errors";
export const register =  async (req,res)=>{
    try {
        const {error} = joi.object({email,password,role_code}).validate(req.body)
         console.log(error);
        if (error) return badRequest(error.details[0]?.message,res)
        const response = await services.register(req.body)
         return res.status(200).json(response)

        
    } catch (error) {
        return internalServerError(res)
    }
}
export const login =  async (req,res)=>{
    try {
        const {email,password} = req.body
         console.log(email,password);
        if(!email||!password) return res.status(400).json({
            mes:'email or password sai '
        })
        const response = await services.login(req.body)
         return res.status(200).json(response)

        
    } catch (error) {
        return internalServerError(res)
        
    }
}

