    static associate(models) {
      Role.hasMany(models.User,{foreignKey:'role_code',as:'roleData'})
    }
  }
  Role.init({
    code: DataTypes.STRING,
    value: DataTypes.STRING
  }, {
    sequelize,
    modelName: 'Role',
  });
  return Role;
};

